import {
    Navbar,
    NavbarBrand,
} from 'reactstrap';


const Header = () => {
    return(
        <header>
            <Navbar className='header'>
                <NavbarBrand>What's happening in:</NavbarBrand>
            </Navbar>
        </header>
    );
};

export default Header;
